import React from "react";
import { Link } from "react-router-dom";
import { Affix } from "antd";
import "./nav.css";

const Nav = () => {
  return (

      <div className='nav-wrapper'>
        <nav className="nav">
          <Link to="/" style={{ fontWeight: "bold", color: "black" }}>
            <h1>통과했수</h1>
          </Link>
        </nav>
      </div>

  );
};

export default Nav;
